import 'package:flutter/material.dart';
import 'dart:async';

import 'package:flutter/services.dart';
import 'package:hanyin_flutter_bluetooth_print/hanyin_flutter_bluetooth_print.dart';

void main() {
  runApp(const MyApp());
}

class MyApp extends StatefulWidget {
  const MyApp({super.key});

  @override
  State<MyApp> createState() => _MyAppState();
}

class _MyAppState extends State<MyApp> {
  String _platformVersion = 'Unknown';
  final _hanyinFlutterBluetoothPrintPlugin = hanyinFlutterBluetoothPrint();

  @override
  void initState() {
    super.initState();
  }

  /// 打印图片
  printImg() async {
    try {
      Map params = {
        // "BDAddress": "00:32:69:05:87:97",
        "BDAddress": "60:6E:41:6C:10:34",
        // "width": "574",
        // "height": "982",
        "width": "555",
        "height": "785",
        // "BDAddress": "00:11:58:05:78:39",
        "url":
            "https://udfs.unisiot.com/group1/M00/0D/09/rBUBAmXpbPuAbiKxAAI17Kgf39g345.png",
        // "url": "https://www.baidu.com/img/flexible/logo/pc/result@2.png",
      };
      var result = await _hanyinFlutterBluetoothPrintPlugin.printImage(params);
      print(result);
    } on PlatformException {
      print('Failed to printImage.');
    }
  }

  /// 打印base64图片
  printBase64Img() async {
    try {
      Map params = {
        // "BDAddress": "00:32:69:05:87:97",
        // "BDAddress": "00:11:58:05:78:39",
        "BDAddress": "60:6E:41:6C:10:34",
        "width": "555",
        "height": "785",
        "base64":
            "data:image/png;base64,",
        // "url": "https://www.baidu.com/img/flexible/logo/pc/result@2.png",
      };
      await _hanyinFlutterBluetoothPrintPlugin.printBase64Image(params);
    } on PlatformException {
      print('Failed to printBase64Image.');
    }
  }

  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      home: Scaffold(
        appBar: AppBar(
          title: const Text('Plugin example app'),
        ),
        body: Center(
          child: Column(
            children: [
              Text('Running on: $_platformVersion\n'),
              TextButton(
                onPressed: () {
                  printImg();
                },
                child: const Text('打印'),
              ),
              TextButton(
                onPressed: () {
                  printBase64Img();
                },
                child: const Text('打印base64'),
              ),
            ],
          ),
        ),
      ),
    );
  }
}
